# Sprint 6 – Planejamento e Validação de Funcionalidades

## Principais ações realizadas:

- Definição das próximas rotas de usuário a serem implementadas;
- Retrospectiva do andamento das implementações da sprint anterior, com foco nos pontos de melhoria;
- Estruturação das próximas etapas do backlog de produto para a semana;
- Testes iniciais das rotas de cadastro de usuários;
- Definição dos testes de aceitação baseados nas rotas previamente definidas;
- Priorização dos requisitos do backlog, considerando o valor de entrega ao usuário.

A Sprint 6 teve como foco principal a preparação para fases mais robustas de testes e a organização das entregas futuras, reforçando a consistência entre as implementações técnicas e os objetivos de acessibilidade da plataforma.

